const ParkCell = ({row,col,operations}) => {
  let visible = row === operations.row && col === operations.row;
  if(visible){
    return (<div> VISIBLE </div>);
  } else {
    return (<div> INVISIBLE </div>);
  }
}
export default ParkCell;
